import { Component, OnInit, ChangeDetectionStrategy, ChangeDetectorRef, ViewChild, ElementRef, AfterViewInit } from '@angular/core';
import { FormControl, Validators } from '@angular/forms';
import { ImageService } from '../../api/image.service';
import { UserService } from 'src/app/api/user.service';
import { first } from 'rxjs/operators';
import { AvatarService } from 'src/app/avatar/avatar.service';
import { DomSanitizer } from '@angular/platform-browser';
import { RteData } from '../rte/editor/rte.component';
import { HttpClient } from '@angular/common/http';
import { UrlService } from 'src/app/api/url.service';
type OPInsertValue = string | { [k: string]: string | number } & { image?: string }
type OPInsert = { insert: OPInsertValue, attributes?: { [k: string]: string | number } }
type OP = {
  ops: OPInsert[]
}

const dataTest: OP = {
  ops: [
    { "insert": "Hello world\n" },
    {
      "attributes":
        { "width": "191" },
      "insert": { "image": "data:image/jpeg;base64," }
    },
    { "insert": "\nLorem ipsum dolor sit, amet consectetur adipisicing elit. Commodi deserunt distinctio esse quis inventore beatae atque, vero labore pariatur incidunt quisquam tenetur corporis nulla repellendus accusantium quia animi, similique sunt?\n" }]
}
@Component({
  selector: 'app-editor',
  templateUrl: './editor.component.html',
  styleUrls: ['./editor.component.scss'],
  host: {
    class: "main-view fx-coll"
  },
  changeDetection: ChangeDetectionStrategy.OnPush
})
export class EditorComponent implements OnInit, AfterViewInit {

  @ViewChild('cnv')
  cnvRef: ElementRef<HTMLCanvasElement>
  avatars: any[] = []
  rteData: RteData
  constructor(
    private ds: DomSanitizer,
    private http: HttpClient,
    private url: UrlService,
    public userService: UserService,
    private cdr: ChangeDetectorRef,
    private avatar: AvatarService) {

    this.control = new FormControl(null, Validators.required)
    this.control.valueChanges.subscribe(value => {
      console.log('this.control.valueChanges', value)
      cdr.detectChanges()
    })
    this.avatars = avatar.list("avataaars", 3, 120)
    /*.map(svg => {
      const res = avatar.svgToObjectURL(svg)
      return ds.bypassSecurityTrustUrl(res)
    })*/
  }
  ngAfterViewInit(): void {
    this.avatar.encode(this.cnvRef.nativeElement, this.avatars[0], 200).subscribe(data => {
      this.svg2src = data
      dataTest.ops.push(
        { insert: "\n" },
        {
          "attributes":
            { "width": "100" },
          "insert": { "image": data }
        })
      this.avatar.encode(this.cnvRef.nativeElement, this.avatars[1], 400).subscribe(data => {
        dataTest.ops.push(
          { insert: "\n" },
          {
            "insert": { "image": data }
          })
        this.control.setValue(dataTest)
        this.control.updateValueAndValidity()
        this.cdr.detectChanges()
      })
    })
  }

  sendMessage() {
    this.http.post(this.url.api("testdata"), dataTest).subscribe(result => {
      this.control.setValue(result)
      this.control.updateValueAndValidity()
      this.cdr.detectChanges()
    },
      err => {
        console.log(err)
      })
  }
  control: FormControl

  svg2src
  ngOnInit(): void {

  }

  cropDone(data) {
    this.userService.updatePicto(data).pipe(first()).subscribe(done => {
      this.cdr.detectChanges()
    },
      error => {
        console.error(error)
      })
  }

}
